CREATE TABLE `inframaterialsreceipts` (
  `AutoMaterialReceiptId` int NOT NULL AUTO_INCREMENT,
  `MaterialId` int DEFAULT NULL,
  `PurchaseOrderId` int DEFAULT NULL,
  `PurchaseOrderId1` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `MaterialReceiptId` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `UserId` int DEFAULT NULL,
  `ProjectId` int DEFAULT NULL,
  `SubProjectId` int DEFAULT NULL,
  `PurchaseDate` date DEFAULT NULL,
  `Quantity` decimal(19,4) NOT NULL,
  `Price` decimal(19,4) DEFAULT NULL,
  `VendorId` int DEFAULT NULL,
  `Metrics` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `DateReceived` date DEFAULT NULL,
  `VoucherDate` date DEFAULT NULL,
  `InvoiceNo` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `VehicleNo` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `Location` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `InvoiceImg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `ReceivedBy` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `Notes` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `UpdatedBy` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `UpdatedTimeStamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`AutoMaterialReceiptId`),
  KEY `par_ind` (`AutoMaterialReceiptId`),
  KEY `ProjectId` (`ProjectId`),
  KEY `SubProjectId` (`SubProjectId`),
  KEY `MaterialId` (`MaterialId`),
  KEY `VendorId` (`VendorId`),
  KEY `UserId` (`UserId`),
  CONSTRAINT `inframaterialsreceipts_ibfk_1` FOREIGN KEY (`ProjectId`) REFERENCES `infraprojects` (`AutoProjectId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `inframaterialsreceipts_ibfk_2` FOREIGN KEY (`SubProjectId`) REFERENCES `infrasubprojects` (`AutoSubProjectId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `inframaterialsreceipts_ibfk_3` FOREIGN KEY (`MaterialId`) REFERENCES `inframaterials` (`AutoMaterialId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `inframaterialsreceipts_ibfk_4` FOREIGN KEY (`VendorId`) REFERENCES `infravendors` (`AutoVendorId`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `inframaterialsreceipts_ibfk_5` FOREIGN KEY (`UserId`) REFERENCES `infrausers` (`AutoUserId`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=492 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
